import React from 'react'

const Header = () => {
  return (
    //style="display: block //style="color:black;"
    //style="border-radius: 80%;width: 50px;font-size: 22px; background-color: rgb(59, 165, 165); color :white;transform:translateX(40%); display: none;"
    <div class="Header">
       <button class="btn" className="loginButton" ><a href="/login" >Login/Register</a></button>
       <button class="btn1" id="registerButton" ><div id="username"></div></button>
    </div>
  )
}

export default Header
